- (void)moveNodeAlongXAxis:(TimelineNode*)node speed:(float)speed {
  CABasicAnimation *animation = [CABasicAnimation animation];
  animation.beginTime = 0; // Set the start time to 0
  animation.duration = 2.0; // Set the duration to 2 seconds
  animation.timingFunction = [CAMediaTimingFunction functionWithFrequency:.2]; // Set the timing function to a basic animation
  animation.fromValue = [node velocity]; // Set the from value to the current velocity of the node
  animation.toValue = [NSNumber numberWithDouble:speed]; // Set the to value to the desired speed of the node
  [node addAnimation:animation forKey:nil]; // Add the animation to the node
}

(void) showModal:(id) sender {

