    [self.view addSubview:modalView];

    // Create a text field to be used for input
    UITextField *textField = [[UITextField alloc] init];
    textField.frame = CGRectMake(15, 50, 240, 50);
    textField.placeholder =@"Enter Text Here";
    [modalView addSubview:textField];

    // Add an action to be taken when the user clicks the "submit" button
    UIButton *submitButton = [UIButton buttonWithType:UIButtonTypeRoundedRect];
    submitButton.frame = CGRectMake(300, 500, 120, 40);
    submitButton.backgroundColor = [UIColor greenColor];
    submitButton.contentHorizontalAlignment = UI alignmentLeading;
    [submitButton addTarget:self action:@selector(submitText) forControlEvent:UIControlEventValueChanged];
    [modalView addSubview:submitButton];
}

